import React, { Component } from "react";
export default class Board extends Component {
  state = {
    board: [],
  };
  constructor(props) {
    super();
    setState({ board: props.board });
  }
  componentDidMount = () => {};

  render() {
    return (
      <React.Fragment>
        <div>this.state.board}</div>
      </React.Fragment>
    );
  }
}
